import React from "react";
import cl from "./MyProduct.module.css"







const MyProduct=({device,searched,dev})=>{

    const k=Date.now()
 


    

    return(
        <div className={cl.whole}> 



  
       {searched?
       dev.searched.map((e)=>{
        <div className={cl.main} key={e.id}>
        <h2>{e.title}</h2>
        <p>{e.description}</p>
        <h3>{e.price}</h3>


       </div>

       })
       :
       device.map((e)=>
       <div className={cl.main} key={e.id}>
        <h2>{e.title}</h2>
        <p>{e.description}</p>
        <h3>{e.price}</h3>


       </div>)}
 

        
        </div>
    )
}

export default MyProduct;
